script: |
  super -f text -I q4576.spq | sort > q4576.out

inputs:
  - name: q4576.spq
    data: |
      SELECT 71 FROM tab2 (FORMAT parquet) AS cor0 WHERE - col1 / col1 NOT BETWEEN NULL AND ( col0 + - col1 - col1 * + col1 );
  - name: tab2

outputs:
  - name: q4576.out
    data: |
      71
      71
      71
